import './paper-row.css'
import { useNavigate } from 'react-router-dom'

    let navigate = useNavigate();

function handleClick(paper) {
    navigate(`/buy/${paper.id}`);
    console.log("Clicked ", paper.id);
}

function PaperRow(paper, index) {
    return (
        <div className="rows" key={index} onClick={() => handleClick(paper)}>
        <div id="paper-row-title">
            {paper.title}
        </div>
        <div id="paper-row-author">
            Author: {paper.author}
        </div>
        </div>
    );
}

export default PaperRow;
